g\"/>\r\n				</p><p>\r\n				</p>',NULL,'/images/15308505891446997210/head/2018-07-06 121629-4289.jpg','/images/15308505891446997210/head/64x64/2018-07-06 121629-4289-64x64.jpg','/images/15308505891446997210/head/125x125/2018-07-06 121629-4289-125x125.jpg','/images/15308505891446997210/head/200x200/2018-07-06 121629-4289-200x200.jpg','/images/15308505891446997210/head/400x400/2018-07-06 121629-4289-400x400.jpg','/images/15308505891446997210/head/800x800/2018-07-06 121629-4289-800x800.jpg',NULL,NULL,'15308505891446997210',1,1,'2018-07-06 04:16:29.000000','2018-10-30 09:09:25.000000'),(1223,'\"高清视频会议通讯多点控制单元MCU LV-60MCU(8A) LV-60MCU(16A)','\"高清视频会议通讯多点控制单元MCU LV-60MCU(8A) LV-60MCU(16A)',133333.00,'<p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">产品描述</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">1.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">大容量：单机</span>120<span style=\"font-family:宋体\">用户，支持级联，级联可支持</span><span style=\"font-family:Calibri\">1000</span><span style=\"font-family:宋体\">用户以上。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">2.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">MCU<span style=\"font-family:宋体\">备份功能，会议中可以随时选中备份</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">接管会议，可以设定策略指定池中的</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">进行故障备份，备份的部分会议自动连接到原有会议；采用云架构，能实现分布式的</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">，任何一个</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">坏或者停止工作不影响，正常使用。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">3.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">符合国际电联</span>ITU H.323<span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">IETF SIP</span><span style=\"font-family:宋体\">标准；兼容</span><span style=\"font-family:Calibri\">SIP</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">视频标准支持</span>H.264 Highprofile<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">H.264 SVC</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持唇音同步、多路混音、回声消除、自动增益、噪音消除。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">实现多路智能混音功能，系统自动根据音量将会场声音加入混音队列。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">音频质量要求能够达到</span>48KHz<span style=\"font-family:宋体\">，支持立体声。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">语音激励功能，终端发言时画面自动弹出显示。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持入会自动静音、全部静音、全部发言、全部闭音、全部发音。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">10.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">视频分辨率：</span>QCIF<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">480P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">D1</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">720P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P24</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P25</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P30</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P50</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P60</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">11.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持混速、混视频格式、混协议会议。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">12.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H.239<span style=\"font-family:宋体\">数字双流技术，主辅流皆可达到</span><span style=\"font-family:Calibri\">1080P60</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">13.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">双流视频：</span>XGA<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">720P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">640</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">480</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1280</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1024</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P</span><span style=\"font-family:宋体\">（</span><span style=\"font-family:Calibri\">1-60</span><span style=\"font-family:宋体\">帧）。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">14.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持唇音同步</span>/<span style=\"font-family:宋体\">多路混音</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">回声消除</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">自动增益</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">噪音消除</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">闭音</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">静音</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">幻象供电。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">15.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持多画面，常见多种多画面布局，每屏最多</span>16<span style=\"font-family:宋体\">画面；支持自动分屏。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">16.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持多种会议模式：导演会议模式，主席会议模式，</span>MCU<span style=\"font-family:宋体\">召集模式，会议室模式，广播模式，自由模式。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">17.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持音视频同步编码或纯音频编码选择。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">18.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持断点重邀功能、支持摄像头远程遥控、支持中英文字幕。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">19.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持语音优先，支持</span>Qos<span style=\"font-family:宋体\">策略，支持</span><span style=\"font-family:Calibri\">H235</span><span style=\"font-family:宋体\">信令加密、</span><span style=\"font-family:Calibri\">AES</span><span style=\"font-family:宋体\">媒体流加密。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">20.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">可设置会议加入密码，会议控制密码，管理员密码</span>,<span style=\"font-family:宋体\">确保会议的安全性。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">21.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">具备双</span>100M/1000M<span style=\"font-family:宋体\">网络接口、可适应</span><span style=\"font-family:Calibri\">DDN</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ISDN</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ATM</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">SDH</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">VPN</span><span style=\"font-family:宋体\">、卫星专线、</span><span style=\"font-family:Calibri\">ADSL</span><span style=\"font-family:宋体\">等线路。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">22.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">具备跨越路由器及防火墙的能力，保证系统安全，支持双网接入。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">23.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">通过</span>Web<span style=\"font-family:宋体\">方式实现设备管理、用户管理、会议管理，支持</span><span style=\"font-family:Calibri\">Telnet</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ssh</span><span style=\"font-family:宋体\">等远程维护方式，根据用户特性、区域特性进行分区管理。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">24.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持多级网络视频管理，也支持扁平化的网络管理。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">25.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">双电源冗余备份，支持热插拔，双网卡智能备份，会场业务自动恢复，集成会议录播模块、内置</span>GK<span style=\"font-family:宋体\">模块。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">26.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持融入式远程呈现、会场直播、点名，一体式会场录制，背景广播等，支持短信或邮件通知召开会议，支持</span>IP Camera <span style=\"font-family:宋体\">直接入会。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">27.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">音频编解码：</span>G.711A<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">G.711U</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">G.722</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">iLBC</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">G.722.1</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">OPUS_16K</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">OPUS_24K</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">OPUS_48K</span><span style=\"font-family:宋体\">等。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">28.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H.263+,H.264<span style=\"font-family:宋体\">视频协议，视频标准支持</span><span style=\"font-family:Calibri\">H.264 Highprofile</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">H.264 SVC</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">29.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">兼容</span>IPV4<span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">IPV6</span><span style=\"font-family:宋体\">；支持组播。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">30.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">会议速率</span>64Kbps-8Mbps<span style=\"font-family:宋体\">之间动态可调 。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">31.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">实现一组会议同时混合</span>QCIF<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">480P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">D1</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">720P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P24</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P25</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P30</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P50</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P60</span><span style=\"font-family:宋体\">会场。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">32.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">在同一多分屏会议中各种分辨率、速率可自由组合，根据人的视觉感官调整。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">33.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">视频分辨率：</span>QCIF<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">480P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">D1</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">720P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P24</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P25</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P30</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P50</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P60</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">34.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持混速、混视频格式、混协议会议，</span>1080P<span style=\"font-family:宋体\">（</span><span style=\"font-family:Calibri\">1-60</span><span style=\"font-family:宋体\">帧），</span><span style=\"font-family:Calibri\">1-60</span><span style=\"font-family:宋体\">帧可手动设置，可自动调节。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">35.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">静态图文：</span>1080P(1-60<span style=\"font-family:宋体\">帧</span><span style=\"font-family:Calibri\">) </span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1280x1024</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">HD 720P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">XGA</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">640x480</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">36.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">512K<span style=\"font-family:宋体\">会议速率可实现</span><span style=\"font-family:Calibri\">1280</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">720P 25/30fps</span><span style=\"font-family:宋体\">动态高清视频效果；</span><span style=\"font-family:Calibri\">1M</span><span style=\"font-family:宋体\">会议速率可实现</span><span style=\"font-family:Calibri\">1920</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 25/30fps</span><span style=\"font-family:宋体\">动态高清视频效果；</span><span style=\"font-family:Calibri\">2M</span><span style=\"font-family:宋体\">会议速率可实现</span><span style=\"font-family:Calibri\">1920</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 50/60fps</span><span style=\"font-family:宋体\">动态高清动态效果。 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">37.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持视频轮询、视频回显、视频录制、视频拍照、图像预览。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">38.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">实现</span>H.239<span style=\"font-family:宋体\">双流协议，主辅流皆可达到</span><span style=\"font-family:Calibri\">1080P60</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">39.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">在双流中主路和辅流图像可同时使用</span>H.264<span style=\"font-family:宋体\">编码协议，支持</span><span style=\"font-family:Calibri\">H.264 Highprofile</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">H.264 SVC</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">40.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">在</span>1920<span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 50/60fps</span><span style=\"font-family:宋体\">高清格式的会议中支持双流功能，辅流图像格式可达</span><span style=\"font-family:Calibri\">1080P</span><span style=\"font-family:宋体\">分辨率。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">41.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">具备双</span>100M/1000M<span style=\"font-family:宋体\">网络接口，可适应</span><span style=\"font-family:Calibri\">DDN</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ISDN</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ATM</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">SDH</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">VPN</span><span style=\"font-family:宋体\">、卫星专线、</span><span style=\"font-family:Calibri\">ADSL</span><span style=\"font-family:宋体\">等线路。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">42.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">具备跨越路由器及防火墙的能力，保证系统安全，支持双网接入。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">43.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持语音优先，支持</span>Qos<span style=\"font-family:宋体\">策略。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">44.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H235<span style=\"font-family:宋体\">信令加密、</span><span style=\"font-family:Calibri\">AES</span><span style=\"font-family:宋体\">媒体流加密，支持会议加入密码、会议控制密码、管理员密码。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">45.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H.264 SVC<span style=\"font-family:宋体\">，支持</span><span style=\"font-family:Calibri\">FEC</span><span style=\"font-family:宋体\">向前纠错功能，当数据丢包率小于</span><span style=\"font-family:Calibri\">20%</span><span style=\"font-family:宋体\">且不是连续的丢包时，画面不会出现模糊不清或严重马赛克的情况。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">46.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">具备跨越路由器及防火墙的能力，保证系统安全，支持双网接入。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">47.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持智能流控功能，包括通知编码和码率自动调整功能，通知编码启动后，</span>MCU<span style=\"font-family:宋体\">会根据终端在</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">上显示的窗口大小自动调节终端的编码参数，码率自动调整功能启动后，</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">端会根据发送信号的丢包、延时等情况自动调整</span><span style=\"font-family:Calibri\">MCU</span><span style=\"font-family:宋体\">的编码码率。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">48.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持音频、主流、辅流网络状态实时显示，包括丢包率、码流、帧率、延时等参数。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">49.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>QOS<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">NAT</span><span style=\"font-family:宋体\">、 </span><span style=\"font-family:Calibri\">H245</span><span style=\"font-family:宋体\">隧道等参数。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">50.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">融入式远程呈现，会场直播、点名，一体式会场录制等。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">51.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持最大</span>120<span style=\"font-family:宋体\">路终端接入，</span><span style=\"font-family:Calibri\">60</span><span style=\"font-family:宋体\">路会议预约、无限制模板定制，支持多画面，常见多种多画面布局，每屏最多</span><span style=\"font-family:Calibri\">16</span><span style=\"font-family:宋体\">画面。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">52.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持自动分屏、导演会议模式、主席会议模式、</span>MCU<span style=\"font-family:宋体\">召集模式、会议室模式、广播模式、自由模式。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">53.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持语音激励功能、支持会议终端挂断所有、邀请离线、删除离线、会场名称设置、横幅设置、滚动消息等会场控制功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">54.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持延长会议时间、结束会议、级联画面设置、主席会场、自动填充、切换布局、音频接收、音频发送、视频接收、视频发送、视频调节、观看视频、信息查询、点名发言、剥夺主席、挂断</span>/<span style=\"font-family:宋体\">呼叫、群组管理会场等会议管理功能。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">55.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">系统应用实现终端异常掉会的自动重邀功能，系统具备</span>5<span style=\"font-family:宋体\">秒内自动恢复会议功能机制；断网</span><span style=\"font-family:Calibri\">5</span><span style=\"font-family:宋体\">秒重连。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">56.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">基于</span>WEB<span style=\"font-family:宋体\">会议管理系统，系统为全英中文图形化操作界面。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">57.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">系统硬件监测功能，能够实时监测系统各硬件模块的工作状态，并具备异常告警功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">58.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>Telnet<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ssh</span><span style=\"font-family:宋体\">等远程维护方式。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">59.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持实现远程控制和远程升级功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">60.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">IP <span style=\"font-family:宋体\">网络诊断：</span><span style=\"font-family:Calibri\">PING</span><span style=\"font-family:宋体\">、丢包、延迟、抖动检测 。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">61.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持网络丢包状态指示</span> <span style=\"font-family:宋体\">、支持事件日志记录，支持配置导入导出</span> <span style=\"font-family:宋体\">、恢复出厂设置。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">62.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持根据用户特性、区域特性进行分区管理，支持大规模终端入会，管理。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">63.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持摄像头远程遥控，分级用户权限，为不同用户分配不同的管理和使用权限。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">64.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">中文用户功能，能够添加，删除，编辑与会终端，可以为与会终端添加分组。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">65.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">通过管理界面，能够对会议的终端状态进行实时监测，包括在线状态和网络丢包率等信息。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">66.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">尺寸（长宽高）：</span>484mmx449mmx177mm<span style=\"font-family:宋体\">，重量：</span><span style=\"font-family:Calibri\">25kg</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">67.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">电气特性</span> <span style=\"font-family:宋体\">工作电压：</span>100VAC<span style=\"font-family:宋体\">～</span><span style=\"font-family:Calibri\">240VAC</span><span style=\"font-family:宋体\">，工作频率：</span><span style=\"font-family:Calibri\">50Hz</span><span style=\"font-family:宋体\">～</span><span style=\"font-family:Calibri\">60Hz</span><span style=\"font-family:宋体\">，最大功耗：小于</span><span style=\"font-family:Calibri\">500W</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">68.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">环境要求温度：</span>10<span style=\"font-family:宋体\">℃ ～</span><span style=\"font-family:Calibri\">35</span><span style=\"font-family:宋体\">℃ </span><span style=\"font-family:Calibri\">(</span><span style=\"font-family:宋体\">工作状态</span><span style=\"font-family:Calibri\">) -40</span><span style=\"font-family:宋体\">℃～</span><span style=\"font-family:Calibri\">55</span><span style=\"font-family:宋体\">℃ </span><span style=\"font-family:Calibri\">(</span><span style=\"font-family:宋体\">非工作状态</span><span style=\"font-family:Calibri\">)</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">69.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">相对湿度：</span>10%<span style=\"font-family:宋体\">～</span><span style=\"font-family:Calibri\">80% (</span><span style=\"font-family:宋体\">工作状态</span><span style=\"font-family:Calibri\">) 0%</span><span style=\"font-family:宋体\">～</span><span style=\"font-family:Calibri\">95% (</span><span style=\"font-family:宋体\">非工作状态</span><span style=\"font-family:Calibri\">)</span><span style=\"font-family:宋体\">。</span></span></p><p><br/></p>',NULL,'/images/1530859566/head/2018-07-06-56-14-07-870518.jpg','/images/1530859566/head/64x64/2018-07-06-56-14-07-870518-64x64.jpg','/images/1530859566/head/125x125/2018-07-06-56-14-07-870518-125x125.jpg','/images/1530859566/head/200x200/2018-07-06-56-14-07-870518-200x200.jpg','/images/1530859566/head/400x400/2018-07-06-56-14-07-870518-400x400.jpg','/images/1530859566/head/800x800/2018-07-06-56-14-07-870518-800x800.jpg',0.00,'','1530859566',1,1,'2018-07-06 06:53:25.000000','2018-10-30 09:09:29.000000'),(1225,'\"高清视频会议通讯终端 LV-1080P-60HT(30A)LV-1080P-60HT(60A)','\"高清视频会议通讯终端 LV-1080P-60HT(30A)LV-1080P-60HT(60A)',26667.00,'<p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">产品描述</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">1.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">符合国际电联</span>ITU H.323<span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">IETF SIP</span><span style=\"font-family:宋体\">标准；兼容</span><span style=\"font-family:Calibri\">SIP</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">2.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H.263+,H.264<span style=\"font-family:宋体\">视频协议，视频标准支持</span><span style=\"font-family:Calibri\">H.264 Highprofile</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">H.264 SVC</span><span style=\"font-family:宋体\">，兼容</span><span style=\"font-family:Calibri\">IPV4</span><span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">IPV6</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">3.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持软硬件终端混合组网，广泛的兼容性，互联互通。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">全高清</span>1080P<span style=\"font-family:宋体\">视频以及支持最高</span><span style=\"font-family:Calibri\">OPUS_48K</span><span style=\"font-family:宋体\">高保真语音。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">智能流控与前向纠错（</span>FEC<span style=\"font-family:宋体\">）算法，抗网络波动。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">可靠：视频终端采用高可靠嵌入式系统设计，可以实现</span>7<span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">24</span><span style=\"font-family:宋体\">小时稳定运行。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持唇音同步、多路混音、幻象供电。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持自动噪声抑制，自动增益控制和自动回声消除功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持会场静音和闭音功能，会场声音输出大小可调。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">10.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">音频质量要求能够达到</span>20KHz<span style=\"font-family:宋体\">（支持双声道立体声效果）。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">11.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">具备高清视频输入、输出接口</span>DVI<span style=\"font-family:宋体\">（或</span><span style=\"font-family:Calibri\">HDMI</span><span style=\"font-family:宋体\">）方便接入各种高清设备。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">12.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">视频分辨率：</span>1080P60/50<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P30/25</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1080P24</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">QCIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4CIF</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">480P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">D1</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">720P</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">13.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">静态图文：</span>1080P(1-60<span style=\"font-family:宋体\">帧</span><span style=\"font-family:Calibri\">) </span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">1280</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1024</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">HD 720P</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">XGA</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">640</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">480</span><span style=\"font-family:宋体\">，中英文字幕。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">14.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H.239<span style=\"font-family:宋体\">数字双流技术，主辅流皆可达到</span><span style=\"font-family:Calibri\">1080P60</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">15.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">512K<span style=\"font-family:宋体\">会议速率可实现</span><span style=\"font-family:Calibri\">1280</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">720P 25/30fps</span><span style=\"font-family:宋体\">动态高清视频效果；</span><span style=\"font-family:Calibri\">1M</span><span style=\"font-family:宋体\">会议速率可实现</span><span style=\"font-family:Calibri\">1920</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 25/30fps</span><span style=\"font-family:宋体\">动态高清视频效果；</span><span style=\"font-family:Calibri\">2M</span><span style=\"font-family:宋体\">会议速率可实现</span><span style=\"font-family:Calibri\">1920</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 50/60fps</span><span style=\"font-family:宋体\">动态高清动态效果。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">16.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">在双流中主路和辅流图像可同时使用</span>H.264<span style=\"font-family:宋体\">编码协议，支持</span><span style=\"font-family:Calibri\">H.264 Highprofile</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">H.264 SVC</span><span style=\"font-family:宋体\">。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">17.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">在</span>1920<span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 60fps</span><span style=\"font-family:宋体\">高清格式的会议中支持双流功能，辅流图像格式可达</span><span style=\"font-family:Calibri\">1080P</span><span style=\"font-family:宋体\">分辨率，</span><span style=\"font-family:Calibri\">1080P</span><span style=\"font-family:宋体\">（</span><span style=\"font-family:Calibri\">1-60</span><span style=\"font-family:宋体\">帧），</span><span style=\"font-family:Calibri\">1-60</span><span style=\"font-family:宋体\">帧可手动设置，可自动调节。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">18.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H.264 SVC<span style=\"font-family:宋体\">，提供抗网络误码能力，可承受</span><span style=\"font-family:Calibri\">20</span><span style=\"font-family:宋体\">％的网络丢包，不影响会议进行。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">19.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持语音优先，支持</span>Qos<span style=\"font-family:宋体\">策略，支持</span><span style=\"font-family:Calibri\">NAT</span><span style=\"font-family:宋体\">穿越。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">20.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>H235<span style=\"font-family:宋体\">信令加密、</span><span style=\"font-family:Calibri\">AES</span><span style=\"font-family:宋体\">媒体流加密，支持会议加入密码、会议控制密码、管理员密码。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">21.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span> IP <span style=\"font-family:宋体\">网络丢包时修复机制，确保丢包达到</span><span style=\"font-family:Calibri\">5%</span><span style=\"font-family:宋体\">时图像无马赛克现象；丢包达到</span><span style=\"font-family:Calibri\">8%</span><span style=\"font-family:宋体\">时，会议依然能够正常召开；</span><span style=\"font-family:Calibri\">20%</span><span style=\"font-family:宋体\">丢包时，图像可以接受。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">22.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">最大呼叫宽带</span>: <span style=\"font-family:宋体\">支持最大</span><span style=\"font-family:Calibri\">8Mbps</span><span style=\"font-family:宋体\">宽带。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">23.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">接入速率</span>: <span style=\"font-family:宋体\">实现</span><span style=\"font-family:Calibri\">64Kbps-8Mbps</span><span style=\"font-family:宋体\">的接入速率。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">24.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持多画面，常见多种多画面布局，每屏最多</span>16<span style=\"font-family:宋体\">画面。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">25.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持单屏双显和双屏双显功能，支持画中画功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">26.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>4<span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">3</span><span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">16</span><span style=\"font-family:宋体\">： </span><span style=\"font-family:Calibri\">9</span><span style=\"font-family:宋体\">显示方式，支持</span><span style=\"font-family:Calibri\">HDMI</span><span style=\"font-family:宋体\">高清电视机音频、视频，可直接接电视机。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">27.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">超强网络适应性，根据网络自动调整分辨率，保障会议的流畅。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">28.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>PC<span style=\"font-family:宋体\">、移动办公，支持</span><span style=\"font-family:Calibri\">3G</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4G</span><span style=\"font-family:宋体\">移动，方便出差使用。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">29.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">易用：两个快捷按钮，一键入会，一键抢麦发言；每个人都能方便使用，不需要专门的网管。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">30.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">一键自动检测功能：一键本地音频、视频测试；测试设备。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">31.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">终端采用遥控器菜单式操作，所见即所得。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">32.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持</span>Telnet<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">ssh</span><span style=\"font-family:宋体\">等远程维护方式。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">33.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">根据用户特性、区域特性进行分区管理。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">34.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">软件升级：支持本地升级、远程升级。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">35.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">网络状态统计功能，能够对通讯中连接的协议、速率和丢包率等进行实时统计。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">36.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持本地音频、视频回路诊断功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">37.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">一键本地音视频测试，网络</span>Ping<span style=\"font-family:宋体\">工具，内嵌中文</span><span style=\"font-family:Calibri\">Web</span><span style=\"font-family:宋体\">管理界面。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">38.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持呼叫日志和历史记录的查询。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">39.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">2<span style=\"font-family:宋体\">路</span><span style=\"font-family:Calibri\">DVI-I</span><span style=\"font-family:宋体\">高清视频输入接口，支持</span><span style=\"font-family:Calibri\">1280</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">720P 60fps/50fps/30fps/25fps</span><span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">1920</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 60fps/50fps/30fps/25fps</span><span style=\"font-family:宋体\">高清输入。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">40.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">2<span style=\"font-family:宋体\">路视频输出接口，</span><span style=\"font-family:Calibri\">HDMI/DVI</span><span style=\"font-family:宋体\">，支持</span><span style=\"font-family:Calibri\">1280</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">720P 60fps/50fps/30fps/25fps</span><span style=\"font-family:宋体\">和</span><span style=\"font-family:Calibri\">1920</span><span style=\"font-family:宋体\">×</span><span style=\"font-family:Calibri\">1080P 60fps/50fps/30fps/25fps</span><span style=\"font-family:宋体\">高清输出。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">41.&nbs