mily:宋体\">采用</span>1/2.8<span style=\"font-family:宋体\">英寸高品质图像传感器，最大分辨率可达</span><span style=\"font-family:Calibri\">1920x1080</span><span style=\"font-family:宋体\">，输出帧率高达</span><span style=\"font-family:Calibri\">60</span><span style=\"font-family:宋体\">帧</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">秒。</span></span></p><p style=\"margin-left: 28px; white-space: normal;\"><span style=\"font-family: 宋体; font-size: 14px;\">3.&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;font-family:宋体\">先进的自动聚焦算法使得镜头快速、准确、稳定地完成自动聚焦。</span></p><p style=\"margin-left: 28px; white-space: normal;\"><span style=\"font-family: 宋体; font-size: 14px;\">4.&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\"><span style=\"font-family:宋体\">支持</span>VISCA<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">PELCO-D</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">PELCO-P</span><span style=\"font-family:宋体\">协议，支持自动识别协议。支持网络全命令</span><span style=\"font-family:Calibri\">VISCA</span><span style=\"font-family:宋体\">控制协议。</span></span></p><p style=\"margin-left: 28px; white-space: normal;\"><span style=\"font-family: 宋体; font-size: 14px;\">5.&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\"><span style=\"font-family:宋体\">支持</span>1.6KHZ<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">3.2KHZ</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4.41KHZ</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4.8KHZ</span><span style=\"font-family:宋体\">采样频率。</span></span></p><p style=\"margin-left: 28px; white-space: normal;\"><span style=\"font-family: 宋体; font-size: 14px;\">6.&nbsp;</span><span style=\"font-family: 宋体; font-size: 14px;\"><span style=\"font-family:宋体\">支持</span>AAC<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">MP3</span><span style=\"font-family:宋体\">、</span><spa