ont-size:14px\">3.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">具有四种会议模式：先进先出模式、普通模式、自由模式、申请发言。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">发言人数限制功能：发言单元数量</span>1<span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">2</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">4</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">6</span><span style=\"font-family:宋体\">可调，主席单元不受限制。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">超强扩展限制功能；主机最多可连接</span>128<span style=\"font-family:宋体\">台发言单元，通过扩展最多可接入</span><span style=\"font-family:Calibri\">4096</span><span style=\"font-family:宋体\">台发言单元。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持签到、投票表决及数据管理功能。</span> </span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">配合电话耦合器可以进行远程电话会议。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">配合摄像跟踪系统可实现视像自动跟踪功能。</span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">技术参数</span></p><table border=\"1\" style=\"width: 568px;border: none\"><tbody><tr><td width=\"157\" valign=\"top\" style=\"width: 157px;padding: 0 7px;border-width: 1px;border-color: windowtext\"><p><span style=\";font-family:宋体;font-size:14px\">型号</span></p></td><td width=\"411\" valign=\"top\" style=\"width: 41