;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">采用最新</span>32<span style=\"font-family:宋体\">位内嵌式处理器，处理速度最高可达</span><span style=\"font-family:Calibri\">720MHZ</span><span style=\"font-family:宋体\">。 &nbsp;&nbsp;</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">主机内置</span>256MDPR<span style=\"font-family:宋体\">及</span><span style=\"font-family:Calibri\">2GEMMC</span><span style=\"font-family:宋体\">存储空间。 </span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">8<span style=\"font-family:宋体\">路独立可编程</span><span style=\"font-family:Calibri\">RS-232</span><span style=\"font-family:宋体\">控制接口，可以收发</span><span style=\"font-family:Calibri\">RS232</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">RS485</span><span style=\"font-family:宋体\">、</span><span style=\"font-family:Calibri\">Rs422</span><span style=\"font-family:宋体\">格式数据。 </span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">8<span style=\"font-family:宋体\">路独立可编程</span><span style=\"font-family:Calibri\">IR</span><span style=\"font-family:宋体\">红外发射口，红外发射口可以做串口使用，使可编程口总数达到</span><span style=\"font-family:Calibri\">16</span><span style=\"font-family:宋体\">个。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">8<span style=\"font-family:宋体\">路数字</span><span style=\"font-family:Calibri\">I/0</span><span style=\"font-family:宋体\">输入输出控制口，带保护电路。 &nbsp;&nbsp;</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">8<span style=\"font-family:宋体\">路弱电继电器控制接口。 &nbsp;&nbsp;&nbsp;</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">10.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">2<span style=\"font-family:宋体\">个网络控制接口，可以并接最大</span><span style=\"font-family:Calibri\">256</span><span style=\"font-family:宋体\">个网络设备。 </span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">11.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持串口环出，任意一个串口输入，可从剩余的任意一个串口环出。</span> &nbsp;</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">12.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">内嵌智能红外学习模块</span>,<span style=\"font-family:宋体\">无需配置专业学习器，可扩展硬学习红外功能</span><span style=\"font-family:Calibri\">,</span><span style=\"font-family:宋体\">方便客户现场更换红外设备而无需再次编程。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">13.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持双代码的控制，即一键发二种代码。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">14.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">采用全贴片式</span> (SMT) <span style=\"font-family:宋体\">生产工艺，采用高度集成化的处理芯片，考究的</span><span style=\"font-family:Calibri\">LAY OUT</span><span style=\"font-family:宋体\">让系统运行非常稳定、流畅。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">15.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">采用全制式环保电源</span> (110V-240V)<span style=\"font-family:宋体\">，适合任何地区。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">技术参数</span></p><table border=\"1\" style=\"width: 568px;border: none\"><tbody><tr><td width=\"180\" valign=