xt-indent:0;line-height:150%\"><span style=\"font-family: 宋体;font-size: 14px\">4.&nbsp;</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14px\"><span style=\"font-family:宋体\">支持最大分辨率达到</span>4Kx2K</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">支持无缝切换功能，切换过程无黑屏信号。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14px\"><span style=\"font-family:宋体\">控制方式灵活，具有</span>1路RS-232、1路RS-485、1路wifi(手机APP）、1路网口（网页）、1路TCP/IP端口（PC软件），</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14pxfont-family:宋体\">支持外接面板控制接口。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">支持音视频</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">信号同步切换</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">，</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">切换响应速度快。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14px\"><span style=\"font-family:宋体\">支持模拟音频与</span>HDMI内嵌音频选择输入。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14px\"><span style=\"font-family:宋体\">支持模拟音频与</span>HDMI内嵌音频同时输出。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-fam