/p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">支持音视频</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">信号同步切换</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">，</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">切换响应速度快。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14px\"><span style=\"font-family:宋体\">支持模拟音频与</span>HDMI内嵌音频选择输入。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14px\"><span style=\"font-family:宋体\">支持模拟音频与</span>HDMI内嵌音频同时输出。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">10.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14px\">HDBaseT输入输出信号支持双向 RS-232 和双向 IR 信号传输，可对RS-232和IR 信号</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14pxfont-family:宋体\">选择随视频信号切换，或分离切换模式</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">，</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14px\"><span style=\"font-family:宋体\">并且支持</span>POC对外供电</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family:宋体;font-size:14px\">11.&nbsp;</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">支持断电记忆功能，避免掉电后重复设置动作。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family: 宋体;font-size: 14px\">12.&nbsp;</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14pxfont-family:宋体\">支持智能温控，控制矩阵风扇的运行</span><span style=\";font-family:宋体;line-height:150%;font-size:14pxfont-family:宋体\">。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family: 宋体;font-size: 14px\">13.&nbsp;</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14pxfont-family:宋体\">系统内可存储多组预切换指令，调用时可以一键切换。</span></p><p style=\"margin-left:0;text-indent:0;line-height:150%\"><span style=\"font-family: 宋体;font-size: 14px\">14.&nbsp;</span><span style=\"font-family: 宋体;line-height: 150%;font-size: 14px\"><span style=\"font-family:宋体\">支持</span>KVM坐席管理功能，通过一套键盘鼠标显示器切换、管理多台计算机设备，为坐席人员带来实时的全方位管控体验。</span></p><p style=\";line-height:150%\"><strong><span style=\"font-family: 宋体;line-height: 150%;font-size: 14px\">&nbsp;</span></strong></p><p style=\";line-height:150%\"><strong><span style=\"font-family: 宋体;line-height: 150%;font-size: 14pxfont-family:宋体\">技术参数：</span></strong><strong></strong></p><table border=\"1\" style=\"width: 568px;border: none\"><tbody><tr><td width=\"155\" valign=\"top\" style=\"width: 155px;padding: 0 7px;border-width: 1px;border-color: windowtext\"><p style=\";line-height:150%\"><span style=\";font-family:宋体;line-height:150%;font-size:14px\">型号</span></p></td><td width=\"412\" valign=\"top\" style=\"width: 413px;padding: 0 7px;border-left: none;border-right-width: 1px;border-right-color: windowtext;border-top-width: 1px;border-top-color: windowtext;border-bottom-width: 1px;border-bottom-color: windowtext\"><p style=\";line-height:150%\"><span style=\";font-family:宋体;line-height:150%;font-size:14px\">LE-7416UHM</span></p></td></tr><tr><td width=\"155\" valign=\"top\" style=\"width: 155px;padding: 0 7px;border-left-width: 1px;border-left-color: windowtext;border-right-width: 1px;border-right-color: windowtext;border-top: none;border-bottom-width: 1px;border-bottom-color: windowtext\"><p style=\";line-height:150%\"><span style=\";font-family:宋体;line-height