25x125.jpg','/images/1530873489/head/200x200/2018-07-06-42-18-22-397109-200x200.jpg','/images/1530873489/head/400x400/2018-07-06-42-18-22-397109-400x400.jpg','/images/1530873489/head/800x800/2018-07-06-42-18-22-397109-800x800.jpg',0.00,'','1530873489',1,1,'2018-07-06 10:39:18.000000','2018-10-20 12:52:44.000000'),(1293,'无纸化多媒体会议管理平台 LE-3800','无纸化多媒体会议管理平台 LE-3800',33333.00,'<p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">产品介绍</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">无纸化会议控制主机通过远程登录</span>web<span style=\"font-family:宋体\">管理，用于处理会议功能模块、人员的权限管理设置、会议信息的实时记录、会议议题、会议主题、参会人员信息、投票内容等信息预设，具有会议各类文件资料的上传共享、等应用功能。运行</span><span style=\"font-family:Calibri\">Windows 7</span><span style=\"font-family:宋体\">操作系统，系统可靠稳定，可为无纸化多媒体会议系统提供管理、控制、数据交互、服务等功能。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">产品特点</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">1.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">处理会议功能模块、人员的权限管理设置、会议信息的实时记录、会议议题、会议主题、参会人员信息、投票内容等信息预设，具有会议各类文件资料的上传共享、等应用功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">2.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持添加多个会议室，并对应添加不同终端，支持对终端进行单个或多个同时升降机控制</span>/<span style=\"font-family:宋体\">开关机控制</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">3.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">可在同一个</span>web<span style=\"font-family:宋体\">界面同时管理多个会议室（可以在同一个界面开启、刷新、结束会议，以及查看会议详情）。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持会前模拟会议室对参会人员进行排位，并导出排位图，</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持上传、导入文件，支持文件设置查看权限，若参会人员无权限查看，终端会自动屏蔽此文件的显示。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持添加、编辑会议议题，并对不同议题进行启用切换。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持用户管理功能，添加、导入、修改、删除用户，支持对用户进行分组，支持建立用户的组织架构，添加用户时可用组织架构来筛选用户。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持不同权限管理模式，含系统管理员、会议秘书、和普通用户，不同会议秘书创建的会议互相保密，系统管理员有管理所有会议的权限。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持创建多个会议模板，会议管理人员可以编辑模板，进行快速会议的创建。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">10.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">会中可以对终端进行欢迎页面、会议信息、显示人名、会议标语等画面的切换，同时支持统一升降机控制、统一开关机。可编辑多张会议标语，可根据议程一键生成多个标语。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">11.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持对会议签到情况进行监控管理。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">12.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">系统支持投票功能，可实时查看结果，亦可投放出显示设备。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">13.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持对服务器中的视频进行任意点播，支持实时观看视频流直播，可全屏显示视频。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">14.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">系统支持浏览以太网网络，无纸化客户端具有内置浏览器，可直接访问邮箱或者</span>OA<span style=\"font-family:宋体\">或者查询资料等。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">15.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持会中及时接收会议服务信息并进行处理。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">16.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持系统后台通知单人或多个参会人员。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">17.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持两人进行点对点会议交流，支持对多人进行实时会议交流。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">18.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">可与中控系统对接，统一管控开机、关机，控制升降器统一升降。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">19.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持多会议标语，在会议中可以任意切换会议标语，方便不同议程议题召开。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">20.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">支持通过</span>APP<span style=\"font-family:宋体\">接收会议服务系统，及时进行处理。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">21.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">B/S<span style=\"font-family:宋体\">架构，可在同一个</span><span style=\"font-family:Calibri\">web</span><span style=\"font-family:宋体\">界面同时管理多个会议室。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">设备参数</span></p><table border=\"1\" style=\"width: 568px;border: none\"><tbody><tr><td width=\"183\" valign=\"top\" style=\"width: 183px;padding: 0 7px;border-width: 1px;border-color: windowtext\"><p><span style=\";font-family:宋体;font-size:14px\">型号</span></p></td><td width