pan style=\";font-family:宋体;font-size:14pxfont-family:宋体\">产品说明</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">1.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\">15.6<span style=\"font-family:宋体\">英寸触控超薄高清显示屏与升降器一体化设计。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">2.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">显示屏显示效果清晰亮丽，可调节背光设计，防止过亮或过暗引发疲劳感。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">3.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">采用进口钢丝与高精密度的导轨和直线轴承配合，交流减速电机做驱动动力，噪音降到最低。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">带麦克风一体升降，话筒升降具有自动扶直功能，当麦杆弯曲时，机器关闭可自动扶直麦杆，不会损坏麦杆。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">无外露连接线、无连接背板、无外露螺丝，保证升降显示触控屏整体美观大方。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">设备采用全铝结构，优质铝材加上</span>CNC<span style=\"font-family:宋体\">精雕加工，显示屏框架、机箱都为铝合金使得设备整体精致、轻便、美观、大气。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">设备的表面处理为阳极氧化处理，色泽光亮，可做喷砂，拉丝等工艺。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持两路视频信号输入，当只有一路信号输入时，屏幕会自动识别信号，当两路信号同时输入时，可通过面板按键手动切换，当无信号输入时，屏幕自动进入省电模式。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">设备支持通过中控软件进行集中控制，可通过主机进行控制，一键可让室内所有的设备都上升或下