">产品描述</span></p><p style=\"text-indent:28px\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">无纸化超薄</span>15.6<span style=\"font-family:宋体\">英寸电容液晶屏升降器，触控超薄高清显示屏与升降器一体化设计，内嵌智能无纸化终端，无外露连接线、无连接背板、无外露螺丝，保证升降显示触控屏整体美观大方。智能</span><span style=\"font-family:Calibri\">15</span><span style=\"font-family:宋体\">°仰角，搭配</span><span style=\"font-family:Calibri\">10.1</span><span style=\"font-family:宋体\">英寸电子桌牌，满足客户系统拓展多样化，办公环境自动化的需求；可广泛应用于会议、办公酒店、教学演播室等多种场合。</span></span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;</span></p><p><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">产品特点</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">1.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">终端客户端软件支持各种主流操作系统，可按用户指定的灵活配备客户端软件，为无纸化多媒体会议系统提供控制和服务功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">2.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">升降器面板航空铝材材质，阳极氧化拉丝工艺；细砂亚银外观设计。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">3.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">自动开合装饰板，超薄机身设计（液晶屏厚度仅为</span>9mm<span style=\"font-family:宋体\">），外形精致美观，彰显机身超现代美感。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">4.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">完全符合人体工程学原理，又不遮挡视线和人脸。使用灵活，稳定性好，抗震性能好。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">5.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">高分辨率真彩数字液晶屏，显示效果清晰亮丽，可调节背光设计，防止过亮或过暗引发疲劳感。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">6.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">低功耗设计，发热小，散热好，支持待机休眠等节电模式。具有电源保护功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">7.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">表面处理工艺精湛，外观、手感兼顾，机械结构设计稳定可靠，平均无故障时间长。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">8.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">纯网络架构，系统布线简单，调试维护方便；可实现远程控制，远程诊断，自动更新和升级。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">9.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">主席权限可对会议投票进行启用、结束、查看统计结果功能。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">10.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">主席权限可以将任一参会人本地画面屏幕广播至全部参会人，也可以结束任一参会人的共享画面。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">11.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">主席权限可控制展示欢迎页面、会议信息、显示人名、会议标语等画面，同时支持统一升降机控制、统一开关机。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">12.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">可对多种文件格式进行阅览，包括常见格式</span>doc/ docx /xls/ xlsx /ppt /pptx/ pdf /html /htm<span style=\"font-family:宋体\">等，支持权限功能，参会人只可看到有权限的文件。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">13.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">升降器桌面面板预设</span>USB<span style=\"font-family:宋体\">信息接口，通过</span><span style=\"font-family:Calibri\">U</span><span style=\"font-family:宋体\">盘，进行阅览文件或上传共享其他参会人员，文件同时可保存在服务器和本地。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">14.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持单人白板或多人同时共享同一画板。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">15.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持与一人或多人进行实时会议交流。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">16.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">可对任意页面进行手写批注，并将批注保存上传至服务器，方便会后进行归档。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">17.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持屏幕自由共享，任何参会人员可以在会议中进行屏幕广播将本地画面共享至其他参会人员。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">18.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">参会人员可以异步浏览退出广播画面进行查看本地文档。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">19.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">可切换无纸化终端为普通电脑使用。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">20.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">会中可以呼叫会议服务，选项包括茶水、笔、纸等，也可自定义输入服务需求；支持会议服务安卓</span>app<span style=\"font-family:宋体\">，可处理不同会议室发来的服务信息。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">21.&nbsp;</span><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\">内置浏览器，支持浏览以太网网络，可访问</span>OA<span style=\"font-family:宋体\">、邮箱等。</span></span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">22.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">支持对服务器中的视频进行任意点播，支持实时观看视频流直播，可全屏显示视频。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">23.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">会议过程中可以随时进行会议笔记记录，并保存上传至服务器，支持下载到本地。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">24.&nbsp;</span><span style=\";font-family:宋体;font-size:14pxfont-family:宋体\">可对会议签到进行开始或统一签到控制，并查看当前状态情况，可对签到情况进行投屏。</span></p><p style=\"margin-left:28px\"><span style=\"font-family:宋体;font-size:14px\">25.&nbsp;</span><span s