018-07-31-22-09-15-327822.jpg\"/></p>',NULL,'/images/1533000059/head/2018-07-31-22-09-31-819153.jpg','/images/1533000059/head/64x64/2018-07-31-22-09-31-819153-64x64.jpg','/images/1533000059/head/125x125/2018-07-31-22-09-31-819153-125x125.jpg','/images/1533000059/head/200x200/2018-07-31-22-09-31-819153-200x200.jpg','/images/1533000059/head/400x400/2018-07-31-22-09-31-819153-400x400.jpg','/images/1533000059/head/800x800/2018-07-31-22-09-31-819153-800x800.jpg',0.00,'','1533000059',1,1,'2018-07-31 01:22:27.000000','2018-10-30 09:10:27.000000'),(2405,'山特动力[3C30K]  不间断电源','山特动力[3C30K]  不间断电源',66000.00,'<p style=\"list-style: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; white-space: normal; line-height: 1.5; clear: both; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">山特3C30K简介<br/>中大功率三进三出UPS，容量从10KVA到200KVA，该系列产品采用先进的数字化设计，高速十六位数字芯片和ASIC的DDC控制技术与先进的大功率器件IGBT及SCR完美组合，设计出大容量、高可靠及卓越性能的智能化UPS。该系列产品是国际最新的硬件，最先进的软件相结合的结晶，为当今集中式服务器机房，网络管理中心和计算机中心提供了可靠电源保护。&nbsp;<br/>【技术参数】<br/>产品特点：<br/>100％的数码技术</span></p><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">采用三块高速微控制器来实现电路控制、参数设定、运行程序管理，先进的自检和自侦测功能，可对电路板上的所有独立电路连接进行自检和故障分析。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">&nbsp;&nbsp;</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">IGBT(Insulated Gate Bipolar Transistor)的卓越性能</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">良好的高速开关特性；具有高电压和大电流工作特性；采用电压型驱动，只需要很小的驱动功率；工作效率高（低损耗和低发热量）；驱动电路小型化，可靠性高。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">完全满足从0到100％负载的跃变</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">UPS能够满足瞬间满负载冲击的要求，无需切换到旁路，保持输出稳定可靠。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">采用瞬时波形控制方式，输出电压波形失真小</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">瞬时波形控制，实现了以瞬时过载平衡度的控制；电流局部循环控制，使逆变器可对负载启动时的冲击电流，以及电涌时的过电流等进行高速控制；前馈控制可使UPS对负载变动进行快速响应。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">昆明山特UPS电源3C30K工频30KVA)合理报价<br/></span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">完善的防瞬态浪涌保护</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">内置D级防雷装置，可承受8/20us，6KV/20KA的浪涌冲击，可有效抑制市电输入端由于感应雷击或电网内大型的感性设备（如空调、电梯、电焊机、空气压缩机、水泵、开关电源等）启动或停止所产生的浪涌电压，将市电输入端钳制在额定范围之内，保证UPS和后端的重要设备不会因为过高的浪涌电压而损坏。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">超低温升设计</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">功率部件采用超低温升设计，大大提高了系统的环境适应能力和可靠性。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">完善的保护功能</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">具有交流输入过、欠压保护；输出过、欠压保护；输出过载、短路保护；逆变器过温保护、电池欠压预警、电池低压保护功能、电池过充电保护等多种保护功能于一体，极大地保证了系统运行的稳定性和可靠性。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">友好的人机界面</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">大屏幕高清晰中文液晶显示界面，简易的操作界面，可方便快捷的了解系统当前运行状态和各项性能参数。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">昆明山特UPS电源3C30K工频30KVA)合理报价<br/></span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">智能监控功能</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">通过RS232接口，配合UPS智能监控软体可与电脑进行通讯，UPS的各种参数一目了然地显示在通讯界面上。通过外置网络监控管理适配卡，UPS具有直接上网功能，提供即时的UPS资料和电源讯息，通过各种网络管理系统进行通讯、管理，使UPS即刻成为网络中的一员。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">完善的电池管理技术</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">在市电正常时，无需电池即可启动UPS，既满足用户的应急需求，也可在最大限度内修复损坏的电池；根据负载的容量自动调整电池放电的终止电压，有效地延长了电池的使用寿命；采用先进的均浮充自动转换的充电技术，节省充电时间，从而延长电池的使用寿命。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">可设置的充电电流</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">根据系统配置电池规格，通过操作界面可以设置相应的最大充电电流，避免由于固定的充电电流所引起的电池过充或欠充现象，最大限度的利用电池。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">冷启动功能</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">&nbsp;&nbsp; 在无市电的状态下，可直接用电池组启动UPS，满足用户的应急需求。并具备超强的冷启动能力，可在满载的情况下进行冷启动操作。</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">三相分调,平衡温压</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\">&nbsp;</div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">&nbsp;&nbsp; 在三相输入电压或负载严重不平衡时,也能完全确保三相输出电压的平衡</span></div><div style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; white-space: normal; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-size: medium;\">昆明山特UPS电源3C30K工频30KVA)合理报价<br/></span></div><p style=\"list-style: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; white-space: normal; line-height: 1.5; clear: both; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">&nbsp;</span></p><p style=\"list-style: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; white-space: normal; line-height: 1.5; clear: both; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">工业型三进三出系列特性说明</span></p><p style=\"list-style: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; white-space: normal; line-height: 1.5; clear: both; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">1</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、先进的</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">IGBT</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">高频脉宽调制技术（</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">PWM</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">）相结合，降低系统噪音及电力损失，确保客户能在各种工作负荷状态下获得高品质电压输出及最高的效益。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>2</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、先进的模组化设计降低平均修护时间（</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">MTTR</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">），维护性最佳。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>3</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、完美的输出缺相保护功能，使</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">三相输出中有一相输出异常或缺相时，则</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">会自动报警，以保护</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">本身及三相负载。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>4</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">100%</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">三相不平衡负载及非线性负载适合性最强，</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">额定容量勿须减额使用。当</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">三相负载</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">100%</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">不平衡或单相，双相带载时，</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">均可正常工作。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>5</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、先进的多组</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">CPU</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">智慧型控制藉由微处理器为基础的数字化软件，能精确掌控</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">各项参数并对其进行全面的控制，提供足够的计算能力，确保</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">随时处于最佳工作状态。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>6</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、采用目前最先进的相位平衡技术，稳定性能好，即使在缺相的情况下仍能正常工作，特别适合于许多电力环境比较恶劣的地方工作。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>7</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、双转换，纯在线式正弦波输出，无论在市电模式或者电池模式，均可输出低失真度的纯净正弦波电源，为用户的负载设备提供最佳的电源保障。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>8</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、输出带隔离变压器，保证负载和公用电网全隔离。装有隔离变压器的</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">，负载中不会出现直流成份，能有效的保护计算机，网络和通讯设备的开关电源不为直流电流损坏，同时，对于非线性负载，也可表现出优良的动态性能，提高了</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">的带载能力，且负载兼容性好。</span></p><p style=\"list-style: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; white-space: normal; line-height: 1.5; clear: both; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">昆明山特UPS电源3C30K工频30KVA)合理报价<br/><br/>9</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">380V±25V</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">宽广的输入电压范围，允许</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">在面对输入电压巨幅变动时能正常工作，减少了电池放电，同时配合优越的充电器对电池充电，因而也增强电池寿命，特别适合于中国电网使用。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/>10</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、高可靠性结构，采用工频经典线路结构与现代高频技术相结合理念设计，具有极高可靠性和</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">“</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">高信噪比</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">”</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">的供电质量，对特底保护负载，保证互联网设备十分有效，这方面的性能大大超过了高频机。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>11</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、特殊的静态开关设计，具备真正的零中断运作，因为</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">8000</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">系列输出具有隔离变压器，可以实现电流隔离，在此基础上设计的静态开关电路，保证任何状态转换下，输出电压均无中断时间，是真正意义的零中断，保护了用户负载正常安全的工作。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>12</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、智能型旁路开关设计，使</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">在旁路模式操作下，可自动侦测市电电压，若输入电压超过额定电压</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">-20%~+15%</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">范围，将自动开关输出，保护负载设备及</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">本身。并且设计单独的旁路开关，可用来做双机并联，或者可以作为发电机的输入，非常方便。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>13</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、透过功能强大的监控软件，在局域网或因特网上就可轻松实现电池定期自检，或者电池的实时充放电，保证了电池的最佳使用状态，实现电池的全自动管理，减少了维护工作。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>14</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、配置冗余式风扇散热系统，转速故障检测，可以更换，并提供故障报警。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>15</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、具有真正意义上的无人值守功能，任何情况下，均可实现市电来电自动开机。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>16</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、根据负载大小自动调节电池放电终止电压，避免固定设置导致的电池过度放电，特别是长时间小电流放电导致的电池过度深放电而损坏电池。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>17</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、使用高裕量器件，大功率</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">IGBT</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">器件使逆变器具有很强过载能力及抗冲击能力，同时增强了对电网的适应能力。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>18</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、自动频率</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">/</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">相应同步功能，避免输入跳频对设备的影响。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>19</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、极小的零地电压差，满足精密设备的供电需求。</span></p><p style=\"list-style: none; margin-top: 0px; margin-bottom: 0px; padding: 0px; border: 0px; white-space: normal; line-height: 1.5; clear: both; font-family: &quot;Hiragino Sans GB&quot;, Tahoma, Arial, 宋体, sans-serif; font-size: 12px;\"><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/>昆明山特UPS电源3C30K工频30KVA)合理报价<br/>20</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、个性化显示界面，超智能电源管理人性化指示面板由小型</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">LCD</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">系统组成，清晰提供</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">运转下的整体状况，市电、电池、输出、负载、机内状态等信息均可通过面板液晶显示，大大方便了操作者和使用者。透过</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">RS232</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">接口实行远程监控，并具有系统自我测试功能，定时开关机功能，各种不同状态的侦测，报警功能，而成为真正智慧型</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>21</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、透过</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">RS232</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">接口，配合</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">“Power manger”</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">智能监控软件可与电脑进行通讯，</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">各种参数一目了然，通过设置电脑可对</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">进行定时开关机，电池自检等多种功能进行直接控制。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>22</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">透过网络监控适配器（</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">SNMP</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">卡）与互联网联网后，配合</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">IP Power UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">网络监控系统软件，则可以将</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">各种参数，信息以数据及图形方式清晰显示在已连网的计算机上，包括</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">的输入电压、输入频率、输出电压、输出频率、负载、温度及电池容量等参数的即时状态，同时可以通过网络进行远程监控</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">，让使用者可以不受空间的限制，更有效管理电力，当市电发生中断或</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">电池低电位时，还具有自动警讯传送功能，如发送短信及电子邮件等知会管理者。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>23</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、电池开关功能本机具有电池开机功能，可在</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\">UPS</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">无市电输入时，允许由电池激活，提供稳定的交流电力输出，为客户提供方便灵活的方案。</span><span style=\"color: black; font-family: Verdana; font-size: 9pt;\"><br/><br/>24</span><span style=\"color: black; font-family: 宋体; font-size: 9pt;\">、完善的保护功能，具有交流输入过压、欠压保护，输出过压欠压保护，输出过载短路保护，电池欠压预警保护，机内过温保护，从而极大的保证了系统运行的稳定性和可靠性。</span></p><p><br/></p>',NULL,'/images/1533000871/head/2018-07-31-41-09-52-939235.jpg','/images/1533000871/head/64x64/2018-07-31-41-09-52-939235-64x64.jpg','/images/1533000871/head/125x125/2018-07-31-41-09-52-939235-125x125.jpg','/images/1533000871/head/200x200/2018-07-31-41-09-52-939235-200x200.jpg','/images/1533000871/head/400x400/2018-07-31-41-09-52-939235-400x400.jpg','/images/1533000871/head/800x800/2018-07-31-41-09-52-939235-800x800.jpg',0.00,'','1533000871',1,1,'2018-07-31 01:41:38.000000','2018-10-30 09:10:27.000000'),(2407,'山特城堡[C1K]  不间断电源','山特城堡[C1K]  不间断电源',3000.00,'<p><br